	(1, 'B010000001', 'B000000001', 'B010000001', 1, 'K160000001', '1', '1', '4', '1', 'K160000001', '우와 게시판이다!!!!!', '<p>여기에 글을 올리면 댓글을 달아주신다는게 정말인가요?</p><p>내부용을 따로 만들어주셔서 감사합니다.</p><p>이거 이미지 업로드도 되는건가요?</p><p>안되면 말고요........</p><p>이건 네이버에디터인가요? 왜 난 RND에 다음에디터를 달고 네이버에디터를 달았다고 착각하고 있었던걸까요.....</p><p>&nbsp;</p><p><span style="color: rgb(255, 170, 0); font-size: 18pt;"><b>여기 에어컨 좀 고쳐주세요!!!!</b></span>&nbsp;</p><p>더워죽겠어요.</p><p>출근하면 더워서 땀이.....................</p><p>&nbsp;ㅠㅠ</p>', NULL, 40, '2016-07-28 17:21:39', '2016-07-28 17:58:43'),
	(1, 'B010000002', 'B000000001', 'B010000002', 1, 'K160000001', '1', '1', '4', '1', 'K160000001', '올~~~~~~~~~~', '<p style="margin-left: 40px;">옭</p>', NULL, 22, '2016-07-28 17:30:03', NULL),
	(1, 'B010000003', 'B000000001', 'B010000003', 1, 'K160000001', '1', '1', '4', '1', 'K160000001', '목록 버튼이 없어서 불편해욤 ㅠ^ㅠ', '<p>&nbsp;</p><p>&nbsp;</p><p>수우우우우정&nbsp;</p><p><span style="font-size: 24pt;"></span></p>', NULL, 36, '2016-07-28 17:35:08', '2016-07-28 17:49:45'),
